//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";


contract LFToken is ERC20 {
    constructor(string memory name,
        string memory symbol,
        uint256 initialSupply,
        uint256 decimals) ERC20(name, symbol) {
        _mint(msg.sender, initialSupply * 10 ** decimals);
    }
}

contract LaunchedTokensStorage {
    address[] launchedTokens;
    constructor(address _owner, address firstLaunchedToken){
        launchedTokens.push(firstLaunchedToken);
    }
}

contract LowFee {
    address private entityOwner = 0x74fDA6B5e26ccC53f50a5cb841c877A875B8B570;
    uint256 private _platformFee = 0.1 ether;

    //Owner => TokenStorage
    mapping(address => address) private _launchedTokensStorages;
    address[] public launchedTokens;

    function buyNewToken(
        string memory name,
        string memory symbol,
        uint256 initialSupply,
        uint256 decimals
    ) public payable {
        require(msg.value == _platformFee, string(abi.encodePacked("The price for creating a new token is ", _platformFee, " BNB!")));
        ERC20 createdToken = new LFToken(name, symbol, initialSupply, decimals);
        address createdTokenAddress = address(createdToken);
        LaunchedTokensStorage launchedTokenStorage = new LaunchedTokensStorage(msg.sender, createdTokenAddress);
        _launchedTokensStorages[msg.sender] = address(launchedTokenStorage);
        launchedTokens.push(createdTokenAddress);
    }
    function getLaunchedTokensFromOwnerAddress(address ownerAddress) public view returns(address){
        return _launchedTokensStorages[ownerAddress];
    }

}
